-
1.Band Neutral Grip Press + Alternating Press (to failure) - While seated on top of the band, grip each loop in hand and keep elbows in a forward/neutral position. Perform a shoulder press, extending the elbows fully for about 12-15 reps, then switching to alternating press for another 10-15 or to failure! Sets/Reps: 4x15/AMRAP.
-
2.Reverse Push up - Get In a Push-up position, instead of pressing straight up, press your hands forward pushing your body back into your hips. Tip: Stiffen your legs/knees to increase resistance in the press. Sets/Reps: 4x12.
-
3.BodyWeight Shoulder Rotation (Mid Delt) - Lie on the ground in a side plank position with your fist forward in the direction of your body. Drive your elbow into the ground and tuck your opposite hand into your chest. Roll forward chest down to create a stretch in the mid delt, then drive the elbow into the ground rotating your body upward SQUEEZING the Delt! Sets/Reps: 4x12ea.
-
4.Band Alternating Rear Delt Fly + Y-Raise - Anchor the band to a post in front of you and grip wide on the loop. Perform a Rear Delt Fly by extending arms outward to the side then alternate to a Y-Raise by extending your arms/hands upward overhead. Sets/Reps: 4x20.
-
5.Lying Y Raise - Using a bench or table top, lie face down, anchor the band to a post behind you or the back two legs on the bench. WIDE Grip the top loop of the band with thumbs facing UP and perform the Y-Raise just like by extending arms straight out and up infront of you! Sets/Reps: 4x15.
